Note: The search engine includes the top 100,000 loans by value. The summary stats page includes all loans!

The public money loaned to companies should be distributed publicly and democratically. Workers should get their fair share. There should not be poverty and a pandemic. There should not be billionaires and people struggling to buy basic necessities.
What is to do be done?
So much!
Write me and let me know what kinds of PPP research would be useful for your project or organization.
Use this website to begin researching companies that received PPP loans.
Share a comment in the discussion section at the bottom of this page.
Examples of Actions that may Promote Fair Distribution of PPP Funds
Omni Hotels & Resorts was accused in December, 2020 of misusing PPP funds. Unite Here, a union of service workers whose members work at Omni, took action by writing the Small Business Administration and urging them to make sure the PPP funds were used appropriately. Considering supporting Unite Here or even join their union.
